const SERVER_ROUTE = {
  ACCOUNT_BY_GAME_NAME: (gameName, tagLine) => "/api/account/ids?",
  ACCOUNT_BY_PUUID: () => "/api/account/ids?",
  SUMMONER_BY_PUUID: (puuid) => `/api/summoner/ids?puuid=${puuid}`,
  MATCH_HISTORY_BY_PUUID: () => "/api/match-history/ids?",
  MATCH_BY_ID: () => "/api/match/ids?`",
};

module.exports = { SERVER_ROUTE };
